	local sprite = {};

	sprite = ConstructSprite("Laila", 2000, 214, 170);
	sprite:SetDirection(hoa_map.MapMode.SOUTH);
	sprite:AddDialogueReference(10);
	sprite:AddDialogueReference(11);
	map:AddGroundObject(sprite);
